import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Add an item to the cart to enable the remove functionality
    await page.waitForSelector('button.add-to-cart', { timeout: 5000 });
    await page.locator('button.add-to-cart').first().click();

    // Wait for the "added to cart" notification to appear and disappear to avoid race conditions
    await page.waitForSelector('.notification.success.show', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));
    await page.waitForSelector('.notification.success.show', { state: 'hidden', timeout: 5000 });


    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_with_item.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_with_item.png'));

    // 3. Remove the item from the cart
    const removeButton = page.locator('button.remove-item');
    await removeButton.click();

    // Wait for the item to be removed and the empty cart message to appear
    await page.waitForSelector('.empty-cart', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    // 4. Extract data to verify the cart is empty
    const emptyCartMessage = await page.locator('.empty-cart').textContent();

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        cartStatus: emptyCartMessage
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        console.error("Failed to take error screenshot:", e);
    }
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
